import React, { Component } from 'react'

export default class Person extends Component {
  render() {
    return (
      <div>
          <input type="text" placeholder='输入名字'/>
          <input type="text" placeholder='输入年龄'/>
          <button>添加</button>
          <ul>
              <li>名字：1---年龄：1</li>
              <li>名字：2---年龄：2</li>
              <li>名字：3---年龄：3</li>
          </ul>
      </div>
    )
  }
}
